def pretextsnapshot(bin, dir):
    with Popen(bin, stdout=PIPE, stderr=STDOUT) as process:
        process.communicate()

    map_path = os.path.join(dir, "test.map")
    save_path = os.path.join(dir, "test_snapshots")

    with open(map_path, "wb") as map_file:
        map_file.write(bz2.decompress(pretext_map))

    with Popen(
        (bin + " -m " + map_path + " -o " + save_path).split(),
        stdout=PIPE,
        stderr=STDOUT,
    ) as process:
        process.communicate()

    with Popen(
        [
            bin,
            "-o",
            save_path,
            "-m",
            map_path,
            "-f",
            "jpeg",
            "-c",
            "1",
            "--gridColour",
            "8080ff80",
            "--sequences",
            "ref_0>ref_1",
        ],
        stdout=PIPE,
        stderr=STDOUT,
    ) as process:
        process.communicate()

    with Popen(
        [
            bin,
            "-o",
            save_path,
            "-m",
            map_path,
            "-f",
            "bmp",
            "-c",
            "Green 2",
            "--gridColour",
            "yellow",
            "--sequences",
            "{ref_0[100]>ref_2,ref_0>ref_2}, ref_2",
        ],
        stdout=PIPE,
        stderr=STDOUT,
    ) as process:
        process.communicate()

    n = 0
    for _, _, filenames in os.walk(save_path):
        for filename in filenames:
            assert filename in test_images
            n += 1
    assert n == len(test_images)

    with open(os.path.join(save_path, "test_FullMap.png"), "rb") as file:
        assert file.read() == bz2.decompress(test_full_map)


